import React, { Component } from 'react';
import Todos from './Todos';

class App extends Component {
  state = {
    todos: [
      { id: 1, content: 'go to market' },
      { id: 2, content: 'close the pump' },
    ]
  };

  render() {
    return (
      <div className="App">
        <h1 className="centre blue-text"></h1>
        <Todos todos={this}></Todos>
      </div>
    )
  }
}

export default App;
